import React from 'react';
import './Banner.css';
import bannerImage from '../assets/logo.png'; // Place your image in assets folder

const Banner = () => {
  return (
    <div className="banner">
      <img src={bannerImage} alt="KM Valuers" />
      <h2 className="banner-text">KM Valuers</h2>
    </div>
  );
};

export default Banner;
